package PolyArraySetGet;

public class Rectangle extends Shape9{
	public int length;
	public int breadth;
	@Override
	public double area() {
		// TODO Auto-generated method stub
		return length*breadth;
	}
	
	public double getRadius() {
		return radius;
	}

	public void setRadius(double radius) {
		this.radius = radius;
	}
	
	

}
